import React from "react";

function Gallery () {
    return (
        <div className="artwork-thumbnails">
                        <img className="img-thumbnail" src={props.topWorks[0].workImg} alt={props.topWorks[0].title}/>
                        <img className="img-thumbnail" src={props.topWorks[1].workImg} alt={props.topWorks[1].title}/>
                        <img className="img-thumbnail" src={props.topWorks[2].workImg} alt={props.topWorks[2].title}/>
                    </div>
    )
}

export default Gallery;
